class Solution(object):
    def partition(self, str):
        """
        :type s: str
        :rtype: List[List[str]]
        """
        dp = [[1 for i in range(len(str))] for j in range(len(str))]

        for end in range(1, len(str)):
            for start in range(0, end):
                if str[start] != str[end] or not dp[end - 1][start + 1] :
                    dp[end][start] = 0
        result = []
        self.all(dp, [], 0, result, str)
        return result

    def all(self, dp, path, cur, result,str):
        if cur >= len(dp):
            result.append(path)
            return
        for end in range(cur, len(dp)):
            if dp[end][cur]:
                self.all(dp, path + [str[cur: end + 1]], end + 1, result, str)

    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """

        dp = [[1 for i in range(len(s))] for j in range(len(s))]
        maxlen = 1
        ss = 0
        ee = 0
        for start in range(len(s) -2, -1, -1):
            for end in range(start + 1, len(s)):
                if s[start] != s[end] or not dp[start + 1][end - 1]:
                    dp[start][end] = 0
                else:
                    if maxlen < end - start + 1:
                        maxlen = end- start + 1
                        ss = start
                        ee = end
        return s[ss:ee + 1]
